use loja;
go

CREATE TABLE [tClientes] (
	[Codigo] numeric(38, 0) NOT NULL PRIMARY KEY, 
	[Nome] nvarchar(50) NOT NULL, 
	[Endereco] nvarchar(50), 
	[Cep] nvarchar(10), 
	[Cidade] nvarchar(30), 
	[Bairro] nvarchar(30), 
	[Estado] nvarchar(30), 
	[Pais] nvarchar(30), 
	[DataCadastro] datetime, 
	[Rg] nvarchar(20), 
	[Cpf] nvarchar(20), 
	[InscricaoEstadual] nvarchar(20), 
	[Cnpj] nvarchar(20), 
	[Telefone] nvarchar(20), 
	[Celular] nvarchar(20), 
	[Email] nvarchar(150), 
	[Site] nvarchar(150)
)
GO

CREATE TABLE [tEstoque] (
	[idEstoque] int NOT NULL IDENTITY(1,1), 
	[CodigoDeBarras] nvarchar(50) NOT NULL PRIMARY KEY, 
	[Produto] nvarchar(50) DEFAULT N'NULL', 
	[DataDeValidade] datetime DEFAULT GETDATE(), 
	[DataDaCompra] datetime DEFAULT GETDATE(), 
	[DataAtualizacao] datetime DEFAULT GETDATE(), 
	[Quantidade] int DEFAULT 0, 
	[ValorCompra] money DEFAULT 0, 
	[PrecoUnitario] money DEFAULT 0, 
	[PrecoDeVenda] money DEFAULT 0, 
	[Estoque] int DEFAULT 0, 
	[Desconto] int DEFAULT 0, 
	[ValorDesconto] money DEFAULT 0
)
GO

CREATE TABLE [tFornecedores] (
	[CodigoDoFornecedor] numeric(38, 0) NOT NULL PRIMARY KEY, 
	[RazaoSocial] nvarchar(50) NOT NULL, 
	[Endereco] nvarchar(50), 
	[Cep] numeric(8, 0), 
	[Cidade] nvarchar(30), 
	[Bairro] nvarchar(30), 
	[Estado] nvarchar(20), 
	[DataCadastro] datetime, 
	[Cnpj] numeric(15, 0), 
	[InscricaoEstadual] numeric(14, 0), 
	[Telefone] numeric(14, 0), 
	[Celular] numeric(13, 0), 
	[Site] nvarchar(82), 
	[Email] nvarchar(82)
)
GO

CREATE TABLE [tFuncionarios] (
	[Codigo] numeric(38, 0) NOT NULL PRIMARY KEY, 
	[Nome] nvarchar(50) NOT NULL, 
	[Endereco] nvarchar(50), 
	[Cep] numeric(8, 0), 
	[Cidade] nvarchar(25), 
	[Bairro] nvarchar(25), 
	[Estado] nvarchar(25), 
	[Pais] nvarchar(25), 
	[RG] numeric(14, 0), 
	[CPF] numeric(11, 0), 
	[EstadoCivil] nvarchar(25), 
	[DataCadastro] datetime, 
	[DataDeNascimento] datetime, 
	[Celular] numeric(11, 0), 
	[Telefone] numeric(11, 0), 
	[CelularContato] numeric(11, 0), 
	[Observacao] ntext, 
	[Foto] image
)
GO

CREATE TABLE [tGestao] (
	[CodigoGestao] numeric(38, 0) NOT NULL PRIMARY KEY, 
	[Gestao] nvarchar(50) NOT NULL, 
	[Impostos] numeric(10, 2) NOT NULL, 
	[CustoFixo] numeric(10, 2) NOT NULL, 
	[Frete] numeric(10, 2) NOT NULL, 
	[Encargos] numeric(10, 2) NOT NULL, 
	[Lucro] numeric(10, 2) NOT NULL, 
	[Anotar] numeric(10, 2), 
	[Promocao] numeric(10, 2)
)
GO

CREATE TABLE [tInadimplentes] (
	[CodigotInadimplente] int NOT NULL PRIMARY KEY, 
	[CodigoCliente] numeric(38, 0) NOT NULL DEFAULT 0.00, 
	[Status] nvarchar(20) NOT NULL DEFAULT 'Liberado', 
	[Data] datetime DEFAULT GETDATE(), 
	[DividaAtiva] bit DEFAULT 0.00, 
	[Encargos] numeric(10, 4) DEFAULT 0.0000, 
	[Observacao] ntext DEFAULT 'null'
)
GO

CREATE TABLE [tPreVendas] (
	[CodigoDaVenda] numeric(38, 0) NOT NULL DEFAULT 0.00 PRIMARY KEY, 
	[CodigoDoCliente] numeric(38, 0) NOT NULL DEFAULT 0, 
	[CodigoDeBarras] numeric(38, 0) NOT NULL DEFAULT 0, 
	[NumeroDaVenda] nvarchar(30) NOT NULL, 
	[Quantidade] numeric(38, 0) NOT NULL DEFAULT 0, 
	[DataDaVenda] datetime NOT NULL, 
	[TipoDeVenda] nvarchar(7) NOT NULL DEFAULT N'A VISTA', 
	[StatusDaVenda] bit NOT NULL DEFAULT 0, 
	[Dinheiro] money DEFAULT 0.00, 
	[DescontoAplicado] money DEFAULT 0.00, 
	[Troco] money DEFAULT 0.00, 
	[Parcela] money DEFAULT 0.00
)
GO

CREATE TABLE [tProdutos] (
	[idProduto] int NOT NULL IDENTITY(549,1), 
	[CodigoDeBarras] nvarchar(15) NOT NULL PRIMARY KEY, 
	[CodigoDoFornecedor] int NOT NULL, 
	[Produto] nvarchar(50) NOT NULL DEFAULT N'v', 
	[DataDeValidade] datetime DEFAULT GETDATE(), 
	[ValorCompra] money DEFAULT 0, 
	[Quantidade] int DEFAULT 0, 
	[Estoque] int DEFAULT 0, 
	[PrecoUnitario] money DEFAULT 0, 
	[PrecoDeVenda] money DEFAULT 0, 
	[Desconto] int DEFAULT 0, 
	[Foto] nvarchar(100) DEFAULT N'v', 
	[DataDaCompra] datetime DEFAULT GETDATE(), 
	[ValorDesconto] money, 
	[CodigoDaNotaFiscal] nvarchar(30)
)
GO

CREATE TABLE [tVendas] (
	[CodigoVenda] int NOT NULL IDENTITY(1,1) PRIMARY KEY, 
	[Data] datetime NOT NULL DEFAULT getdate(), 
	[Valor] money NOT NULL, 
	[Custo] money NOT NULL, 
	[Status] nvarchar(10) DEFAULT 'FECHADO'
)

